import React, { useState, useEffect } from 'react';
import axios from 'axios';
import MapComponent from '../components/MapComponent';
import GlobeComponent from '../components/GlobeComponent';

function Dashboard({ onLogout }) {
  const [stats, setStats] = useState({});
  const [logs, setLogs] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
    try {
      const token = localStorage.getItem('adminToken');
      const headers = { Authorization: `Bearer ${token}` };

      const [statsResponse, logsResponse] = await Promise.all([
        axios.get('/admin/stats', { headers }),
        axios.get('/admin/logs', { headers }),
      ]);

      setStats(statsResponse.data);
      setLogs(logsResponse.data.logs);
    } catch (err) {
      setError('Failed to fetch dashboard data');
    } finally {
      setLoading(false);
    }
  };

  const handleLogout = () => {
    onLogout();
  };

  if (loading) {
    return <div className="dashboard">Loading dashboard...</div>;
  }

  return (
    <div className="dashboard">
      <div className="dashboard-header">
        <h1>Server Management Dashboard</h1>
        <button onClick={handleLogout} className="btn">
          Logout
        </button>
      </div>

      {error && <div className="error">{error}</div>}

      <div className="stats-grid">
        <div className="stat-card">
          <h3>Total Requests</h3>
          <p>{stats.totalRequests || 0}</p>
        </div>
        <div className="stat-card">
          <h3>Unique IPs</h3>
          <p>{stats.uniqueIPs || 0}</p>
        </div>
        <div className="stat-card">
          <h3>Unique Countries</h3>
          <p>{stats.uniqueCountries || 0}</p>
        </div>
      </div>

      <div className="map-container">
        <h3>Request Locations (Map)</h3>
        <MapComponent logs={logs} />
      </div>

      <div className="globe-container">
        <h3>Request Locations (3D Globe)</h3>
        <GlobeComponent logs={logs} />
      </div>

      <div className="logs-table">
        <h3>Recent Request Logs</h3>
        <table>
          <thead>
            <tr>
              <th>Time</th>
              <th>Method</th>
              <th>Path</th>
              <th>IP</th>
              <th>Country</th>
              <th>City</th>
            </tr>
          </thead>
          <tbody>
            {logs.map((log) => (
              <tr key={log.id}>
                <td>{new Date(log.time).toLocaleString()}</td>
                <td>{log.method}</td>
                <td>{log.path}</td>
                <td>{log.ip}</td>
                <td>{log.country}</td>
                <td>{log.city}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default Dashboard;
